import React from 'react';
import './Header.css';

function Header() {
  return (
    <div class="header">
      <div className="header-logo row">
        <img class="logo-img" src="/cctracker-logo.png" alt=""></img>
        <div className="logo-text">CCTracker</div> 
      </div>
    </div>
  )
}

export default Header
